import React from 'react'
import { Button } from '@chakra-ui/button'

const SMButton = () => {
    return(
        <Button
            sx={{
                shadow: "lg",
                rounded: "lg",
                bg: "white",
            }}
        >
            Click me
        </Button>
    )
}

export default SMButton
